// src/components/OrderDetails.js
import React, { useState, useMemo } from 'react';
import OcrUploader from './OcrUploader';
import './OrderDetails.css';

function OrderDetails({ data }) {
  const [selectedMonth, setSelectedMonth] = useState(null);
  const [searchUserId, setSearchUserId] = useState('');
  const [selectedStatus, setSelectedStatus] = useState('');
  const [ocrParsed, setOcrParsed] = useState([]); // OcrUploader가 전달한 파싱 결과

  const handleMonthFilter = (month) => setSelectedMonth(month);
  const handleClearFilters = () => {
    setSelectedMonth(null);
    setSearchUserId('');
    setSelectedStatus('');
  };

  // 기존 데이터 필터링 (정확 일치 userId)
  const filteredData = useMemo(() => {
    return data.filter(order => {
      const monthMatch = selectedMonth ? (new Date(order.orderDate).getMonth() + 1) === selectedMonth : true;
      const userMatch = searchUserId
        ? String(order.userId).trim().toLowerCase() === searchUserId.trim().toLowerCase()
        : true;
      const statusMatch = selectedStatus
        ? String(order.status).trim().toLowerCase() === selectedStatus.trim().toLowerCase()
        : true;
      return monthMatch && userMatch && statusMatch;
    });
  }, [data, selectedMonth, searchUserId, selectedStatus]);

  return (
    <div className="order-details-container">
      <div className="filters">
        <div className="month-buttons">
          {['1','2','3','4','5','6'].map(m => (
            <button key={m} onClick={() => handleMonthFilter(Number(m))}>{m}월</button>
          ))}
          <button onClick={handleClearFilters}>전체 보기</button>
        </div>

        <div className="search-user-id">
          <input
            type="text"
            placeholder="사용자 ID 검색 (정확히 일치)"
            value={searchUserId}
            onChange={(e) => setSearchUserId(e.target.value)}
          />
        </div>

        <div className="status-filter">
          <select value={selectedStatus} onChange={(e) => setSelectedStatus(e.target.value)}>
            <option value="">상태 선택</option>
            <option value="배송완료">배송완료</option>
            <option value="배송중">배송중</option>
            <option value="결제완료">결제완료</option>
            <option value="환불요청">환불요청</option>
          </select>
        </div>
      </div>

      {/* OCR 업로더(자식) : onParsed 콜백으로 파싱된 배열을 받음 */}
      <div className="ocr-section">
        <h4>이미지에서 주문 내역 추출 (OCR)</h4>
        <OcrUploader onParsed={(parsed) => setOcrParsed(parsed)} />
      </div>

      {/* OCR 파싱 결과 표 */}
      {ocrParsed && ocrParsed.length > 0 && (
        <>
          <h5>OCR로 추출된 주문 (편집/확인 가능)</h5>
          <div className="ocr-table">
            <table>
              <thead>
                <tr>
                  <th>주문 ID</th>
                  <th>사용자 ID</th>
                  <th>주문 날짜</th>
                  <th>상태</th>
                  <th>총 금액</th>
                </tr>
              </thead>
              <tbody>
                {ocrParsed.map((o, i) => (
                  <tr key={o.orderId ?? `${i}`}>
                    <td>{o.orderId}</td>
                    <td>{o.userId}</td>
                    <td>{o.orderDate}</td>
                    <td>{o.status}</td>
                    <td>{o.totalAmount}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </>
      )}

      <h4>필터된 주문 목록</h4>
      <div className="order-list">
        {filteredData.length === 0 ? (
          <p>해당 조건에 맞는 주문 내역이 없습니다.</p>
        ) : (
          <table className="order-table">
            <thead>
              <tr>
                <th>주문 ID</th>
                <th>사용자 ID</th>
                <th>주문 날짜</th>
                <th>상태</th>
                <th>총 금액</th>
              </tr>
            </thead>
            <tbody>
              {filteredData.map(order => (
                <tr key={order.orderId}>
                  <td>{order.orderId}</td>
                  <td>{order.userId}</td>
                  <td>{order.orderDate}</td>
                  <td>{order.status}</td>
                  <td>{order.totalAmount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default OrderDetails;
